import React from 'react';

export default class App extends React.Component{
  render(){
    const animais = [
      "Cachorro",
      "Gato",
      "Galinha",
      "pit",
      "Peixe",
    ];
    return (
        <div>
          <h1>Lista de animais:</h1>
          <ul>
            {
              animais.map((animal, index) => {
                console.log(`O animal ${animal}, possui o index ${index}`);
                return <li key={index}>{animal}</li>;
              })
            }
          </ul>
        </div>
      );
  }
}
